&gt;&quot;Love Blactually&quot;
&gt;Brian sets his sights on a girl named Carolyn and follows Stewie's advice to
&gt;take things slow with the relationship, only to drive her crazy and straight
&gt;into Cleveland's arms. Brian does whatever it takes to win her back, even if
