&gt;Stewie find it so annoying that they try to prevent it from being heard again.
&gt;Distraught, Peter searches every record store in town for a copy of the song
&gt;until he runs into Jesus himself, and the two start hanging out.
&gt;
&gt;Episode #3:
&gt;&quot;Road to Germany&quot;
