&gt;Stewie go back in time to retrieve him. Things look bad when they discover 
&gt;that they've arrived in World War II-era Poland, so they must travel to Nazi
&gt;Germany to save Mort and find a way to safely return to the present.
&gt;
&gt;Episode #4:
&gt;&quot;Baby not on Board&quot;
&gt;Peter gets a lasting supply of gasoline for the year, so the family decides to
&gt;use it to take a road trip to the Grand Canyon. They pack up and hit the
&gt;road, but it takes them a while to realize that they had forgotten to bring
&gt;Stewie with them; when they do, they must make an explosive trip back home.
&gt;
&gt;Episode #5:
&gt;&quot;The Man with Two Brians&quot;
&gt;When Brian gets injured during a take of Peter's version of Jackass, the 
&gt;Griffins realize that Brian may be getting too old, so Peter brings home a
&gt;new dog, prompting Brian to leave. Everyone else, however, loves &quot;New 
&gt;Brian&quot;; all except for Stewie, who doesn't like his constant happy attitude.
&gt;
&gt;Episode #6:
&gt;&quot;Tales of a Third Grade Nothing&quot;
&gt;Peter's up for a promotion at work, but he is forced by his boss Angela to be
&gt;sent back to repeat the third grade in order to qualify. Meanwhile, Frank 
&gt;Sinatra, Jr. returns to Quahog to open a new nightspot with Brian, and they
&gt;enlist Stewie to make it the hottest new spot in town.
&gt;
&gt;Episode #7:
&gt;&quot;Ocean's Three and a Half&quot;
&gt;Bonnie finally gives birth to her baby, a beautiful girl named Susie, with
&gt;whom Stewie falls in love and will do anything to win her heart. Meanwhile,
&gt;Joe borrows $20,000 from a loan shark to pay for Bonnie's medical bills, and
&gt;plans to steal the money from Mr. Pewterschmidt to pay off his debt.
&gt;
&gt;Episode #8:
&gt;&quot;Family Gay&quot;
&gt;Peter participates in some medical experiments to pay off his debt, including
&gt;one that sees him getting injected with the &quot;gay gene&quot;. Peter winds up in a
&gt;gay relationship and leaves Lois and the rest of the family heartbroken,
&gt;though they realize the most important thing is that Peter is happy.
&gt;
&gt;Episode #9:
&gt;&quot;The Juice Is Loose&quot;
