&gt;&quot;Not All Dogs Go to Heaven&quot;
&gt;Meg becomes a born-again Christian and tries to convert Brian from atheism.
&gt;Meanwhile, Stewie is furious he doesn't get to ask the cast of Star Trek: 
&gt;The Next Generation any questions at a convention, so he kidnaps the cast
