&gt;Episode #12
&gt;&quot;420&quot;
&gt;After Brian is arrested for drug possession, he launches a campaign to legalize
&gt;marijuana. Mayor West passes the law, and the whole town goes to pot.
&gt;
&gt;Episode #13
&gt;&quot;Stew-Roids&quot;
&gt;After Stewie gets his butt kicked by Joe's infant daughter, he starts hitting the
&gt;gym with Peter. It seems like all of Stewie's hard work is paying off until Peter
