&gt;is like physics as in &quot;What goes up, must come down&quot;.
&gt;
&gt;Episode #14
&gt;&quot;We love you, Conrad&quot;
&gt;Brian is devastated to learn that his ex-girlfriend Jillian is getting married 
&gt;until he meets The Hills star Lauren Conrad. Though Brian begins to think
&gt;he and Conrad are the perfect match, he finds his heart may still belong to Jillian.
&gt;
&gt;Episode #15
&gt;&quot;Three Kings&quot;
&gt;Peter imagines his friends and family in three of Stephen King's most famous works.
&gt;Stand by Me parody - Twelve-year old Peter, Quagmire, Cleveland and Joe travel
&gt;along a railroad track on a journey of self-discovery.
&gt;Misery parody - Brian is injured in a bad car crash only to be &quot;rescued&quot; by his
&gt;&quot;number one fan,&quot; Stewie. The Shawshank Redemption parody - Cleveland and Peter
&gt;become fast friends in prison.
